    margin-right: 2em;
    a {
      position: relative;
      text-decoration: none;
      font-size: $font-med + 0.2rem;
      color: $color2;
      &:not(:last-child) {
        margin-right: 30px;
      }
      &::before {
        content: '';
        display: block;
        position: absolute;
        height: 0.15em;
        left: 0;
        right: 0;
        bottom: -5px;
        color: $color2;
      }
      &:hover {
        color: rgb(0, 0, 0);
      }
    }
    a {
      position: relative;
      font-size: $font-med + 0.2rem;
      color: $color2;
      &:not(:last-child) {
        margin-right: 30px;
      }
      &::before {
        content: '';
        display: block;
        position: absolute;
        height: 3px;
        left: 0;
        right: 0;
        bottom: -10px;
        color: $color2;
      }
      &:hover {
        color: rgb(0, 0, 0);
        &::before {
          background: $color2;
        }
      }
    }
  }
  &__cta {
    font-size: $font-med;
    color: $color2;
  }
}

.circleBehind a:before,
.circleBehind a:after {
  position: absolute;
  top: 22px;
  left: 50%;
  width: 50px;
  height: 50px;
  border: 4px solid #0277bd;
  transform: translateX(-50%) translateY(-50%) scale(0.8);
  border-radius: 50%;
  background: transparent;
  content: '';
  opacity: 0;
  transition: all 0.3s;
  z-index: -1;
}

