      height: 12px;
      margin-right: 10px;
      border-radius: 50%;
      border: 1px solid #999;
      background-color: #efefe8;
      cursor: pointer;
    }
  }
  @for $i from 1 through $slider-number {
    #s-#{$i}:checked {
      & ~ .s-content {
        transform: translateX(-$slider-width * ($i - 1));
      }
      & ~ .s-control .s-c-#{$i} {
        background-color: #333;
      }
      & ~ .s-nav .s-nav-#{$i} {
        display: block;
      }
    }
  }
}

.s-type-1 {
  .s-content {
    animation: slider-animation 20s ease-in-out infinite;
    &:hover {
      animation-play-state: paused;
    }
  }
}

@keyframes slider-animation {
  $i: 0;
  $j: 0;
  $times: ($slider-number - 1) * 2;
  @while $i < 100 {
    #{$i}%,
    #{$i + 7}% {
      @if $i < 50 {
        transform: translateX(-$slider-width * $j);
      } @else {
        transform: translateX(-$slider-width * ($times - $j));
      }
    }
    $i: $i + 100 / $times;
    $j: $j + 1;
  }
}

